import React, { useEffect, useState } from 'react';
import Logo from './Logo';
import Assets from '../img/Assets.png';
import Services from '../img/Services.png';
import Sam from '../img/sam.png';
import Messages from '../img/Messages.png';
import Settings from '../img/Settings.png';
import Logout from '../img/Logout.png';
import { Link, useLocation } from 'react-router-dom';

const item_list1 = [
    {
        imgsrc: Sam,
        imgalt: 'Segment anything',
        text: 'Segment anything',
        id: 'Segment_any_thing',
        to: '/'
    },
    {
        imgsrc: Messages,
        imgalt: 'Contact Us',
        text: 'Contact Us',
        id: 'Contact_Us',
        to: '/messages'
    },
    {
        imgsrc: Assets,
        imgalt: 'About',
        text: 'About',
        id: 'About',
        to: '/assets'
    },
    {
        imgsrc: Services,
        imgalt: 'Services',
        text: 'Services',
        id: 'Services',
        to: '/services'
    },
];

const item_list2 = [
    {
        imgsrc: Settings,
        imgalt: 'Settings',
        text: 'Settings',
        id: 'Settings',
        to: '/setting'
    },
    {
        imgsrc: Logout,
        imgalt: 'Logout',
        text: 'Logout',
        id: 'Logout',
        to: '/logout'
    }
];

function Navbar({ isDarkMode, toggleMode }) {
    const location = useLocation();
    const [activeLink, setActiveLink] = useState(location.pathname);

    useEffect(() => {
        setActiveLink(location.pathname);
    }, [location]);

    return (
        <div className={`row ${(isDarkMode) ? "bg-dark " : "bg-light "} bg-opacity-50  navbar d-md-flex d-none flex-column justify-content-start col-xl-2 col-lg-3 col-4 p-4 m-0`} key="nav">
            <Logo isDarkMode={isDarkMode} />
            <div className="row col-12 p-3 pe-4 pt-5">
                <div className="col-12 d-flex flex-column justify-content-start">
                    {item_list1.map((item) => (
                        <Link to={item.to} className={`${isDarkMode ? "text-light" : "text-dark"} text-decoration-none m-0 p-0 d-flex`} key={item.id}>
                            <button className={`row col-12 my-1 mx-0 py-2 border-0 ${isDarkMode ? "bg-dark text-light" : "bg-light text-dark"} rounded-2 bg-opacity-50 navitem ${activeLink === item.to ? 'bg-purple' : ''}`}>
                                <img src={item.imgsrc} alt={item.imgalt} className='col-3' />
                                <h6 className='col-9 m-0 p-0'>{item.text}</h6>
                            </button>
                        </Link>
                    ))}
                </div>
            </div>
            <div className='nav_item_down p-4 '>
                <div className="row col-12 p-3 pe-4 pt-5">
                    <div className="col-12 d-flex flex-column justify-content-start">
                        {item_list2.map((item) => (
                            <Link to={item.to} className={`${isDarkMode ? "text-light" : "text-dark"} text-decoration-none m-0 p-0 d-flex`} key={item.id}>
                                <button className={`row col-12 my-1 mx-0 py-2 border-0 ${isDarkMode ? "bg-dark text-light" : "bg-light text-dark"} rounded-2 bg-opacity-50 navitem ${activeLink === item.to ? 'bg-purple' : ''}`}>
                                    <img src={item.imgsrc} alt={item.imgalt} className='col-3' />
                                    <h6 className='col-9 m-0 p-0'>{item.text}</h6>
                                </button>
                            </Link>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Navbar;
